const Container = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
`;

productsQuerry;

const Products = () => {
  useEffect(() => {
    fetch("http://localhost:4000/");
  });

  return (
    <div>
      <Container>
        {arr.map((item) => (
          <Product item={item} key={item.id} />
        ))}
      </Container>
    </div>
  );
};

export default Products;
